import React from 'react'
import BoardRow from './BoardRow'

const Board = (props) => {
    const { handleChange } = props
    const nineArray = [1, 2, 3, 4, 5, 6, 7, 8, 9]
    return (
        <div>
            <table>
                <tbody>
                {nineArray.map((element) => {
                    return <BoardRow 
                            key={element}
                            id={element.toString()}
                            handleChange={handleChange}
                    />
                })}
                </tbody>

            </table>
        </div>
    )
}

export default Board
